import React from 'react';

function Header() {
    return (
        <header>
            <nav>
                <h1>Its a mine App</h1>
                <ul>
                    <li>Page 1</li>
                    <li>Page 2</li>
                    <li>Page 3</li>
                </ul>
            </nav>
        </header>
    )
};

export default Header;
